
import PropType from "prop-types";

const kimchiImg = "data:image/jpeg;base64,";

const doobooImg = "data:image/jpeg;base64,";

const carImg = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRdaQd_9Ik8Q3CIZvcFw-gMEWyyeiR-9ZKVQVyarQ_-H1DG2ujnD6MPjtadkQ&usqp=CAc";

const foodIlike = [
  {
    id: 1,
    name: "kimchi",
    image: kimchiImg,
    rating: 5,

  },
  {
    id: 2,
    name: "dooboo",
    image: doobooImg,
    rating: 3.9,
  },
  {
    id: 3,
    name: "car",
    image: carImg,
    rating: 4.5
  },
]

function Food({name, pic, rating}) {
  return (
    <div>
      <h2>I like {name}</h2>
      <h4>{rating}/5.0</h4>
      <img src={pic} alt={name}/>
    </div> 
  );  
}

Food.propTypes = {
  name: PropType.string.isRequired,
  pic: PropType.string.isRequired,
  rating: PropType.number.isRequired,
}


function App() {
  return (
    <div>
      {foodIlike.map(dish => (
        <Food 
          key={dish.id} 
          name={dish.name} 
          pic={dish.image} 
          rating={dish.rating}/>
      ))}
    </div>
  );
}

export default App;
